    "comprehensive-conservation-plan-for-prime-hook-national-wildlife-refuge-march-2013",nt"isopen":
    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Prime Hook National Wildlife Refuge for the next
    15 years. This plan outlines the Refuge vision and purpose and describes how the
    Refuge will contribute to the overall mission of the Refuge System. The plan provides
    an introduction to the Refuge, an overview of the CCP process, a summary of Refuge
    resources, and information about the management direction. Key planning issues include:
    climate change/sea level rise /overwash and marsh management, mosquito control,
    cooperative farming program, hunting opportunities.",nt"license_title": "License
